{"product_id": "730", "page": 149, "page_order": 2, "recommended": true, "date": "2021-01-07", "text": "If your looking for a review on csgo you've come to the wrong place, but if your looking for an outstanding pie recipe you've come to the right place.\nIngredients:\n1. 6 tablespoons unsalted butter\n2. 1/2 cup white sugar\n3. 1/2 cup brown sugar\n4. 1/4 cup water\n5. 1/4 teaspoon cinnamon\n6. 1 pinch salt\n7. 5 apples - peeled, cored and sliced\n8. 1 pastry for double-crust pie\nDirections:\n1. Preheat oven to 425 degrees F (220 degrees C).\n2. Combine butter, white sugar, brown sugar, water, cinnamon, and salt in a saucepan over medium heat. Bring to a boil, remove from heat and set aside.\n3. Roll out half the pastry to fit a 9-inch pie plate. Place bottom crust in pie plate; pour in apple slices.\n4. Roll out top crust into a 10-inch circle. Cut into 8 (1-inch) wide strips with a sharp paring knife or pastry wheel. Weave the pastry strips, one at a time, into a lattice pattern. Fold the ends of the lattice strips under the edge of the bottom crust and crimp to seal.\n5. Pour butter-sugar mixture over top of pie, coating the lattice, and allowing any remaining sauce to drizzle through the crust.\n6. Bake in the preheated oven for 15 minutes. Reduce heat to 350 degrees F (175 degrees C), and bake until the crust is golden brown, the caramel on the top crust is set, and the apple filling is bubbling, 35 to 40 more minutes. Allow to cool completely before slicing.", "hours": 0.4, "username": "Feli", "products": 20, "early_access": false}
