{"product_id": "730", "page": 242, "page_order": 2, "recommended": true, "date": "2021-01-06", "text": "surf guide:\n-dont use the w key it will not work in surfing\n-momentum is key\n-never ever turn sharply like 90 degrees sharp it will slow you down to much\n-gradual curving of your mouse is the best way to turn usually\n-the sharper you turn your mouse the higher you go with proper momentum\n-the slower and less that you turn your mouse the more speed you get after the ramp\n-for momentum you always wanna hit as close to the top and beginning of the ramp as you can then gradually move down to the bottom of the ramp (although not always necessary) to make the jump\n-generally assuming you have the speed you will have to turn in the air to hit that point on the ramp\n-slamming down or falling on the side of the ramp will also kill your speed\n-now for your two keys a and d are the only keys you will need to surf and your mouse\n-if the ramp goes right to left you hit the d key\n-goes left to right you hit the a key\n-turning in the air will require you to hold the respective key to the direction you are pointing basically you turning right hold d you turn left hold a\n-if you want a private map to practice you will have to go in steam workshop and subscribe to a map to get it\n-in public servers go to play and search in the customs\ndont get mad if you dont get it at first it took me a  bit for it to click\nand dont worry if you fail on a section you can retry till you get it\nhave fun surfers", "hours": 7.3, "compensation": "Product received for free", "user_id": "76561198820240398", "username": "Godspeed", "products": 33, "early_access": false}
