{"product_id": "730", "page": 275, "page_order": 9, "recommended": true, "date": "2021-01-06", "text": "Oh how I miss you my poopy, if only there was some type of higher being I could pray to that would relive me of my struggles. I close my eyes for a split second and I see a form appear. Out of fear and surprise I open them swiftly to be scared yet again by my TV randomly turning on to static. The noise is static-like but it doesnt sound like regular static. Its almost as if its a voice but not a voice of threat or danger but a voice of security. I stare at the flickering screen for a few seconds until I gather up the courage to get out of bed and turn it off. I had to crawl to the TV because of the injuries Cringe-Mommy inflicted. As I put my finger on the power button the screen stopped showing static and went black. I had yet to put preassure on the power button and I froze up thinking it turned off by just the slight touch. Suddenly an image fades into the screen. \"Looney Tunes\". I used to love watching these shows so I figured why not just lay back in bed and watch, maybe it will make me feel better. It was a spree of episodes, each better than the last. Suddenly an unfamiliar episode title appeard \"Wabbit Twouble\". I felt a chill go down my spine for some reason. The episode starts as any other episode and I am pretty invested into it in just the first minute. Suddenly I notice something. The ground, trees, events and of course the hole getting boarded up. This was the best episode of all, the episode which started so much and brought joy into many lives. Bugs opens the hatch, walks out and becomes Big Chungus. But instead of saying his lines or moving in any way he just stands there, frozen, staring, staring at me...\nI felt as my entire body started becoming weak but also filled with this vigor and excitement which I havent felt in a while. I blink and the scene is empty. No more Big Chungus or Bugs Bunny. My door opens and I see the silhouette of a large and rotund creature with a powerful energy enveloping it. It steps into the light of my room and closes the door behind itself. Its him, Big Chungus, Big \u2665\u2665\u2665\u2665\u2665\u2665\u2665 Chungus is in my room.", "hours": 354.0, "user_id": "76561198197137061", "username": "chunbus", "products": 49, "early_access": false}
