{"product_id": "730", "page": 285, "page_order": 1, "recommended": true, "date": "2021-01-06", "text": "Well, I have played this game for 30+ Hours, so time to review it. Overall I give this game 9/10 stars, the mechanics of the game are super fun, as well as the map design. I haven't really encountered that many bugs so far while playing, and have only encountered one hacker. The game is super fun to play with friends and runs on smooth 140 fps for me. The only few minor issues I have with this game are that the respawn points are kind of bad, in that you respawn randomly around the map which means the odds of being spawnkilled are higher. But when you respawn you have a short time of invunerablility that helps with this a little bit. Another thing I don't really like is that when you start getting shot you can't move, which is sort of annoying when somebody is behind you and you are trying to get away. Other than that this game seems pretty solid (especially for a free game) there are some in-game purchases which can be a bit annoying, but other than that CS:GO creates a long-lasting gaming experience.", "hours": 59.8, "compensation": "Product received for free", "user_id": "76561199120344537", "username": "|[INVICTUS]| Revolt", "products": 1, "early_access": false}
