{"product_id": "730", "page": 374, "page_order": 0, "recommended": true, "date": "2021-01-05", "text": "- - -[ Audience: ] - - -\n\u2611 Your Mom probably would enjoy this\n\u2610 Kids\n\u2611 Everyone\n\u2610 Everyone except kids\n\u2611 Casual players\n\u2611  Pro players\n\u2611  People who plan to take one game and make it their life\n- - - [ Graphics/Animation: ] - - -\n\u2610 I want to poor bleach in my eyes\n\u2610 MS-DOS\n\u2610 Bad, but playable.\n\u2611 Decent\n\u2611 Good\n\u2610 Beautiful\n\u2610 You forget what reality is\n---[ Price: ]---\n\u2611  Free\n\u2610 Buy now\n\u2610 Worth the price\n\u2610 Wait for sale\n\u2610Maybe if you have some spare money left\n\u2610 Do not buy it\n\u2610 Do not throw money into a trash can\n- - - [ Requirements: ] - - -\n\u2610  Check if you can run paint\n\u2610 90's PC\n\u2611 Minimum\n\u2610 Medium\n\u2610 High end\n\u2610 NASA computer\n- - - [ Difficulty: ] - - -\n\u2610 You just need 2 arms\n\u2610 Easy\n\u2610 Easy to learn / Hard to master\n\u2611 Average (Depends on the difficulty set)\n\u2611 Significant brain usage (for ranked - only ranks higher than silver)\n\u2610 Dark Souls\n\u2610 Only the best of the best can complete this game\n---{Grind}---\n\u2610Nothing\n\u2611Only if you care about leaderboards/ranks\n\u2610 Isn't necessary to progress\n\u2610 Average grind level\n\u2610 A bit grindy...sometimes\n\u2610 Go back to the last village and shoot some more scarecrows\n\u2610 Practically a full time job\n- - - [ Story] - - -\n\u2611 Only gameplay, doesn't include a story.\n\u2610 There is a story, but most of the game is focused on gameplay.\n\u2610 Better than nothing I suppose...\n\u2610 Average.\n\u2610 Decent.\n\u2610 Amazing!\n\u2610 It\u2018ll replace your life\n- - - [ Bugs ] - - -\n\u2610 Game itself is one big BUG\n\u2610 Ark: Survival Evolved\n\u2610 Lot of bugs (Can get annoying)\n\u2611 Few Bugs\n\u2610 You can use them for speedrun\n\u2610 Nothing (I've seen)\n---[ Game Time ]---\n\u2611 Long enough for a cup of tea\n\u2610 Short\n\u2610 Not too short\n\u2610 Depends on you\n\u2611 Long ( if playing a good team on ranked)\n\u2610 Very Long\n\u2610 Endless\n- - - [ Enjoyment ] - - -\n\u2610 One long, tedious grind\n\u2610 Better than mobile\n\u2611 Fun at first, but gets old after a bit\n\u2610 Consistently fun\n\u2610 Can't stop playing, even though I should be finished\nI started playing CSGO from the huge amount of requests I got from friends to check it out. And I'm glad I did. It's a great game overall. It's a game where you can get together with friends, and have a fun or serious match.  It's a LOT of fun, when you have people to play with.\nA casual, party game meant to be played with friends. It's a game that requires a great amount of skill.It's definitely a game worth playing, but it isn't a game that you should take and replace your life with.\nThe core gameplay loop does get boring relatively quickly, because there is nothing to work towards unless you play ranked. It simply exists as a fun, round-by-round type game. Nothing more, and nothing less.\nWhy do I recommend against buying it? The PC version is free, completely free to play!\nI suggest that if you to play CSGO, that you save your money and don't gamble, all the highlights on YouTube of really high priced skins being unboxed are not realistic\nI hope you found this review helpful! Please leave me a rating, and give me your thoughts in the comments, as I would love to hear feedback, ideas, and what personal experiences you've had with this title.", "hours": 487.7, "username": "Anno", "products": 16, "early_access": false}
