{"product_id": "730", "page": 379, "page_order": 8, "recommended": true, "date": "2021-01-05", "text": "I thought I made one again but I'll redo; I really enjoyed this game a lot and I still do, what makes it the best is if you're feeling stressed and competitive is becoming boring with your friends than I recommend doing all kinds of workshop maps! There are tons of good ones that cater to all kinds of genres: story line ones with pretty cool cut scenes, mini-games, hide'n'seek, 1v1's, 5v5's with all of your friends and so much more, but aside from that whether it be competitive, casual, dangerzone, wingman, war games or deathmatch you'll be able to play with your friends and be able to meet some more people as well! Sadly not all communities are the best and csgo can get kinda toxic, nevertheless you shouldn't let that get to you because there are always great people or fun people you'll meet in any kind of match. One downside to csgo is sometimes there will be hackers or smurfs, you don't get hackers really if you have prime but you'll still get smurfs, but keep in mind usually those people are on those alt accounts to player with their lower level friends, so don't try to let it get to you too much! Overall I believe csgo is a good game and has been for awhile after all the updates and care they put into it, the operations are pretty cool and every time a new case comes out with skins everyone gets excited. It's great they pull some skins from the workshop even from players that give them ideas! I hope it just gets better from here!", "hours": 2246.9, "user_id": "76561198162645067", "username": "Cay <3", "products": 53, "early_access": false}
