{"product_id": "730", "page": 459, "page_order": 5, "recommended": true, "date": "2021-01-04", "text": "Pretty fun so far.\nThe game has a simple concept behind it that has a reward system, kind of, for playtime, not how many wins you have. The game has cool features with the market like custom weapon weapon skins, and crates, and a good variety of weapons to learn to use on both teams. Rather than a reward/grindy system, its about the replay value, and learning the lay of the land on each map, choke points, communication, and also mainly fun. Many people have played thousands of hours on the game, to get better, and to have some fun since it has great replay value, and cool features, and tons of achievements to work towards, which im a fan of. So honestly, its quite good in public lobbies, but im sure with friends, it could be one of the best games out there, and it also has millions of concurrent players, so when you play, and gett better, its not totally useless, the game has a large, and solid playerbase, with many types of people at many different skill levels, so very fun overall.", "hours": 3.8, "user_id": "76561199121914141", "username": "Kinua", "products": 26, "early_access": false}
