{"product_id": "730", "page": 577, "page_order": 9, "recommended": true, "date": "2021-01-03", "text": "This game is incredibly fun to play and the graphics are improved greatly. However, I do have problems with this game.\n1. Optimization: I used to get 60 FPS before when I only had 4 gb ram. Ever since the panorama update came out, my frame-rate dropped from 60 FPS to 20 FPS (despite having 8 gb ram) which is unacceptable. It makes the game unplayable for low end users and it will affect our aim.\n2. Bots: The bots in this game feels much more tone-downed than before and it's easier. The bots in later games (CS 1.6, CS:S, etc) are more of a challenge than CS:GO's bots. The expert difficulty was a challenge in older CS, now in CS:GO it isn't expert. It feels like you're fighting against Easy Bots from CS 1.6\nOther than that, this game is still fun to play and I highly recommend you to play this.", "hours": 8.4, "username": "Fractional Void", "products": 13, "early_access": false}
